import { Container, Row, Col, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../Standard-Component-style.css'
import './Not_Fount.css'

export default function Not_Fount_Component() {
    const { t, i18n } = useTranslation("global");
    return(
        <Container fluid className='fluid-fix'>
            <div className='not-fount-container'>
                <div>
                    <h1>404 Error</h1>
                    <img src="/img/icon.png" alt={t("404.icon-alt-text")}></img>
                    <p></p>
                </div>
            </div>
        </Container>
    )
}
